/*
功能介绍：
  关键词重定向参数格式：@remsg@重定向后的关键词
  伪装消息参数格式：@mask@平台@ones@群组ID@ones@好友ID@ones@用户ID@ones@消息
  伪装删除参数格式：@mask@@delmsg@平台@ones@群组ID@ones@好友ID@ones@用户ID
  管理命令参数格式：@admincmd@命令
  管理推送参数格式：@adminpush@平台@ones@消息@ones@类型@ones@路径
  用户推送参数格式：@userpush@平台@ones@群组ID@ones@用户ID@ones@消息@ones@类型@ones@路径
  标准请求参数格式：@requrl,API地址,请求方式get/post,返回json节点,请求body@
基本指令：
  botreply key keyword                           //向数据库中添加新的回复[半角空格用“%20”；全角空格用“%E3%80%80”]
  botreply list key|public                       //数据库中关键词列表
  botreply key get                               //删除数据库指定key[半角空格用“%20”；全角空格用“%E3%80%80”]
  botreply key del                               //读取数据库指定key[半角空格用“%20”；全角空格用“%E3%80%80”]
  botreply empty                                 //清空所有关键词，慎用
  botreply upkey oldkey|>>|newkey                //更新key，回复内容不变
  botreply treply oldkeyword|tt|newkeyword       //替换回复中的部分内容
  botreply dbadd key|++|str                      //数据库中添加数组元素
  botreply dbdel key|--|str                      //数据库中删除数组元素
黑白名单：
  @keyblacklist@                                 //key黑名单
  @groupblacklist@ @groupwhitelist@              //群组黑白名单，选择一个使用，两个同时存在只生效黑名单
  @userblacklist@ @userwhitelist@                //用户黑白名单，选择一个使用，两个同时存在只生效黑名单
  @oneblacklist@ @onewhitelist@                  //私聊黑白名单，选择一个使用，两个同时存在只生效黑名单
传参指令：
  @remsg@                                        //重定向标识符
  @mask@                                         //伪装消息标识符
  @mask@@delmsg@                                 //伪装删除标识符
  @admincmd@                                     //管理命令标识符
  @adminpush@                                    //管理推送标识符
  @userpush@                                     //用户推送标识符
  @recallmsg@                                    //撤回消息识别符
  @chatcom@                                      //关键词标识符
  @regexp@                                       //正则匹配key标识符
  @ones@                                         //通用分隔符
  @type@                                         //文件类型分隔符，发送文件类型不为text时使用此标识符分割
  |@@|                                           //多条回复内容分割标识符
  @sfrom@                                        //平台
  @groupid@                                      //群组id
  @userid@                                       //用户id
  @admin@                                        //管理员权限
  @msgself@                                      //消息内容
  @msgid@                                        //消息id
  @groupname@                                    //群组名称
  @username@                                     //用户名称
  @nowdate@                                      //当前日期
  @nowtime@                                      //当前时间
  @userkeyword@                                  //消息内容(剔除模糊匹配词)
  @nodel@                                        //持久消息(不受自动删除的约束)
  @delayN@                                       //延时发送秒数(N改为整数)
  @nochat@                                       //禁止创建回复路径
  @deldelayN@                                    //延时删除回复的秒数(N改为整数)
  @recalldelayN@                                 //延时撤回消息的秒数(N改为整数)
  @requrl,url,get/post,back,body@                //请求网页获取返回的数据[back为返回的节点；多节点使用“|”分割；多层使用“&”分割]
  @reqext:back@                                  //请求网页返回的多节点存储定义
  data[]back1.back2:txt1.txt2:type.back          //数组读取规范,配合requrl读取返回数组使用
  {[at]}                                         //字符“@”的转义替代符
  @nowtimestamp@                                 //当前时间戳
  <:>                                            //属性与值的分隔符
  [:]b                                           //属性类型[true|false]
  [:]n                                           //属性类型[Number]
  @whitelist,from:groupId:userId@                //数据库白名单
  @base64,url|path@                              //转换url或path文件为base64  
  @savefile,url@                                 //保存文件
  @savefile,path,url@                            //保存文件
  @savefile,path,url,name@                       //保存文件
  @replace,thq,thh@                              //替换内容
示例：
  参照：https://github.com/xmoxmo/bncr
*/

